import styled from 'styled-components'

const StyledHeader = styled.header`
    display: flex;
    height: 2em;
`;

const Button = styled.button`
    
`;

const Header = () => {
    return (
        <StyledHeader>
            <Button>Main Menu Icon</Button>
            <h2>WMS </h2>
        </StyledHeader>
    )
}

export default Header
